                <input placeholder='nombre completo'/>
                <input placeholder='nombre completo'/>
                <input placeholder='nombre completo'/>
                <input type='submit'/>
            </div>
            <FooterLayout></FooterLayout>
        </div>
    )
}

export default Newsletter;
